import { useEffect, useState } from "react";


let AmbulanceProfilePg1 = () => {

    
    let aid=JSON.parse(localStorage.getItem("loginInfo")).aid;
    const[ambulance,setAmbulance]=useState([]);

    useEffect( ()=>{

                fetch("http://localhost:8080/getprofiledetails?aid="+aid)
                .then(resp=>resp.json())
                .then(data=>setAmbulance(data))
    },[] );

    return(


        <div>
        <h2>hiiiii {aid} </h2>

        <table className="table table-bordered">
                {
                    ambulance.map((a)=>{
                        // return (
                            <tr>
                                <td>{a.drivername}</td>
                                <td>{a.aregno}</td>
                                {/* <td>{v.completed.toString()}</td> */}
                            </tr>
                        // )
                    })
                }
            </table>
            {ambulance.length}


        </div>
    )




}
export default AmbulanceProfilePg1;
